import React from 'react';
import { Link } from 'react-router-dom';
import heroImage from '../assets/hero-doberman.jpg';
import logo from '../assets/logo.png';

const Home = () => {
    return (
        <div className="bg-gray-900 text-white min-h-screen flex flex-col">
            {/* Navbar */}
            <header className="bg-gray-950 bg-opacity-90 fixed w-full shadow-md p-4">
                <div className="container mx-auto flex justify-between items-center">
                    <Link to="/" className="flex items-center">
                        <img src={logo} alt="Logo" className="h-12 w-auto" />
                        <h1 className="text-2xl font-bold ml-3">Doberman Breeding</h1>
                    </Link>
                    <nav className="hidden md:flex space-x-6">
                        {["About Us", "Available Puppies", "Gallery", "Testimonials", "Blog", "Contact"].map((item, index) => (
                            <Link key={index} to={`/${item.toLowerCase().replace(/ /g, '-')}`} className="hover:text-gray-400">
                                {item}
                            </Link>
                        ))}
                    </nav>
                </div>
            </header>

            {/* Hero Section */}
            <main className="flex-grow flex items-center justify-center relative">
                <div className="absolute inset-0 bg-black bg-opacity-50"></div>
                <img src={heroImage} alt="Doberman Hero" className="absolute inset-0 w-full h-full object-cover" />
                <section className="relative text-center px-6 py-24">
                    <h2 className="text-5xl font-extrabold mb-6 drop-shadow-md">Welcome to Our Doberman Family</h2>
                    <p className="text-lg mb-6 max-w-2xl mx-auto drop-shadow-md">
                        We are dedicated to breeding healthy, happy Dobermans with excellent temperaments.
                    </p>
                    <Link to="/available-puppies" className="bg-blue-600 text-white py-3 px-6 rounded-lg hover:bg-blue-500 transition shadow-lg">
                        View Available Puppies
                    </Link>
                </section>
            </main>

            {/* Sections */}
            <section className="bg-gray-800 py-12 px-6 text-center grid md:grid-cols-2 gap-8">
                {["Our Mission", "Why Choose Us?"].map((title, index) => (
                    <div key={index}>
                        <h3 className="text-3xl font-bold mb-4">{title}</h3>
                        <p className="text-lg">{index === 0 ? "We strive to breed top-quality Dobermans that are healthy, intelligent, and well-socialized." : "Our breeding program prioritizes temperament, genetics, and ethical breeding standards."}</p>
                    </div>
                ))}
            </section>

            <section className="py-12 px-6 text-center">
                <h3 className="text-3xl font-bold mb-6">Testimonials</h3>
                <p className="text-lg">See what our happy clients have to say about our Dobermans.</p>
                <div className="mt-6">
                    <Link to="/testimonials" className="bg-blue-600 text-white py-2 px-4 rounded hover:bg-blue-500 transition">
                        Read Testimonials
                    </Link>
                </div>
            </section>

            <section className="bg-gray-800 py-12 px-6 text-center">
                <h3 className="text-3xl font-bold mb-4">Join Our Community</h3>
                <p className="text-lg">Follow us on social media to stay updated with our latest litters and events.</p>
                <div className="mt-6 flex justify-center space-x-6">
                    {["Facebook", "Instagram", "Twitter"].map((platform, index) => (
                        <a key={index} href={`https://www.${platform.toLowerCase()}.com`} target="_blank" rel="noopener noreferrer" className="text-blue-400 hover:text-blue-300">
                            {platform}
                        </a>
                    ))}
                </div>
            </section>

            {/* Footer */}
            <footer className="bg-gray-800 text-center py-4 mt-6">
                <p>&copy; {new Date().getFullYear()} Doberman Breeding Business. All rights reserved.</p>
            </footer>
        </div>
    );
};

export default Home;
